import Layout from '../components/Layout';

const Index = (props) => {
    console.log(props);
    return (
    <Layout>
        Hello world. home page
    </Layout>
    )
}

Index.getInitialProps = async () => {
    const data = await fetch('https://jsonplaceholder.typeicode.com/posts');
    const result = await data.json();
    return {
        posts: result
    }
}

export default Index;
